var offsetStart = 0;
var offsetEnd = 0;
window.addEventListener('scroll', () => {
  document.documentElement.style.setProperty('--scroll', ( window.pageYOffset - offsetStart ) / ( document.body.offsetHeight - offsetStart - offsetEnd - window.innerHeight ));
}, false);

function App() {
  return (
  <body>

      <div id="App" className="sticky"  ></div>

      <div id ="picture" className="sticky"><img id ='picture1' src={pic1} alt="picture1" /></div>
  </body>
  );
}



export default App;
